description:
Foggy morning, rainy days: the children read and the children play. If you are lost in a maze just raise your gaze, there are so many ways that you’d be amazed: Where are you headed? Where are you now? You might find yourself taking a vow: remember these days especially now, when all your foundation went under a plough. Your mind is surrounded by old haze of grey, hounds of deception on your memory prey. Spray the nostalgia, spray it away! Those castles you lived in no longer remain! Know you can always build them again, bigger to fit all of what you became.

---

